import Layout from "../components/Layout/Layout.component";
import Button from "../components/Buttons/Button.component";

const Connect = () => {
	return (
		<Layout>
			<div>
				<h1>CONNECT</h1>
				<Button>Button</Button>
				<Button>Another Button</Button>
			</div>
		</Layout>
	);
};

export default Connect;
